import React from 'react';
import Pokemon from './Pokemon';

class Pokedex extends React.Component {
  render() {
    return (
    <div>
      {this.props.pokemons.map((objeto) => 
      (<Pokemon pokemonOBJ={objeto} key={objeto.id} />))}
    </div>
    )
  }
}

export default Pokedex;
